import React from "react";

const Comments = () => {
  return (
    <>
      <div className="container">
        <div className="row my-5">
          <div className="col-md-9 me-5  float-start ">
            <input
              type="text"
              className="form-control form-control-lg"
              placeholder="Name ..."
            />
          </div>
          <div className="col-md-10  my-2 py-2">
            <textarea
              className="form-control form-control-lg"
              placeholder="Your Comments Here ..."
            />
          </div>{" "}
          <div className="col-md-10  my-2 py-2">
            <button className="form-control form-control-lg btn btn-secondary btn-lg">
              Submit
            </button>
          </div>
        </div>
      </div>{" "}
    </>
  );
};

export default Comments;
